        <div class="my-8 grid gap-2 text-sm">
          <div class="flex items-center gap-2">
            <span class="text-slate-400"
              >{{ $t("messages.shop.availability") }}:
            </span>
            <StockStatus
              :status="stockStatus"
              @updated="mergeLiveStockStatus"
            />
          </div>
          <div class="flex items-center gap-2">
