        <form @submit.prevent="addToCart(selectProductInput)">
          <AttributeSelections
            v-if="
              product.type == 'VARIABLE' &&
              product.attributes &&
              product.variations
            "
            class="mb-8 mt-4"
            :attrs="product.attributes.nodes"
            :variations="product.variations.nodes"
            @attrs-changed="updateSelectedVariations"
          />
          <div
            class="fixed bottom-0 left-0 z-10 mt-12 flex w-full items-center gap-4 bg-white bg-opacity-90 p-4 md:static md:bg-transparent md:p-0"
          >
            <input
              v-model="quantity"
              type="number"
              min="1"
              aria-label="Quantity"
              class="flex w-20 items-center justify-center gap-4 rounded-lg border bg-primary/10 p-2.5 text-left focus:outline-none"
            />
            <AddToCartButton
              class="w-full flex-1 md:max-w-xs"
              :disabled="disabledAddToCart"
              :class="{ loading: isUpdatingCart }"
            />
          </div>
        </form>

